import React from 'react';
import Service from "./Service";
import Text from "../../../helpers/Text";
import {css, StyleSheet} from "aphrodite";
import check from "../../../../image/check.svg"

function ServiceText({id, name = "Service name", price = 10}) {
    const checkBox = {
        height: "1.2rem",
        width: "1.2rem",
        borderRadius: "50%",
        marginRight: "14px",
    }
    checkBox.backgroundColor = "#5454D4"
    checkBox.border = "1px solid #979797";
    const style = StyleSheet.create({
        checkBox: checkBox,
    })

    return (
        <Service
            firstComponent={
                <div className="alItCenter row">
                    <div className={css(style.checkBox) + " row alItCenter jccenter"}>
                        <img src={check}/>
                    </div>
                    <Text text={name}> </Text>
                </div>
            }
            secondComponent={
                <Text text={"$ "+ price} color={"#979797"} size={"0.9rem"}/>
            }/>
    );
}

export default ServiceText;
